The graduation party for Mitsuki and Rina gets underway, with everyone giving them presents. During the party, as Yuu gets into an arguement with Mitsuki over her kissing relationship with Haruka, Mitsuki, upon hearing that their kissing is part of a 'special friendship', confesses her love to Haruka. Following the graduation ceremony, Haruka is called about Mitsuki, who discovers Haruka knows nothing about love or dating and misinterpreted Mitsuki's confession. Haruka ends up rejecting Mitsuki, who leaves her with just a kiss on the forehead. Yuu, who had been watching them, bring Haruka to the old classroom, where they kiss whilst telling each other they love each other. With their feelings stronger than ever, Haruka and Yuu step foot into their second year of school.
